import styled from "styled-components";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Dashboard from "../comps/Home/Dashboard";

function Home() {
  return (
    <>
      <Router>
        <div className="Home">
          <header>
            <div>
              <h1>Basic CRM</h1>
            </div>
            <hr />
          </header>

          <Switch>
            <Route exact to="/" component={Dashboard} />
          </Switch>
        </div>
      </Router>
    </>
  );
}

export default Home;
